import React from 'react';
import { useExperiment } from '../context/ExperimentContext';

const SwitchPanel = ({ onTaskComplete }) => {
  const { 
    designType, 
    lightStates, 
    toggleSwitch, 
    isTaskActive,
    targetAreas,
    taskSuccess
  } = useExperiment();

  const areas = ['A', 'B', 'C', 'D'];

  const handleSwitchToggle = (areaId) => {
    if (!isTaskActive) return;
    toggleSwitch(areaId);

    // Check if task is complete (handled in context, but we can emit event here too)
    if (taskSuccess === true && onTaskComplete) {
      // Task completion is handled in context
    }
  };

  // Traditional switch panel layout
  const TraditionalLayout = () => (
    <div className="w-full">
      <h3 className="mb-6 text-gray-800 text-xl font-semibold text-center">
        Traditional Light Switch Panel
      </h3>
      <div className="flex gap-6 p-6 bg-gray-50 rounded-xl border-2 border-gray-200 justify-center items-center">
        {areas.map((area) => (
          <div key={area} className="flex flex-col items-center gap-2">
            <label className="text-sm font-medium text-gray-700">Area {area}</label>
            <div 
              className={`w-12 h-20 bg-gray-300 rounded-2xl relative cursor-pointer transition-all duration-300 border-2 ${
                isTaskActive 
                  ? 'hover:scale-105 border-gray-400' 
                  : 'opacity-50 cursor-not-allowed border-gray-300'
              } ${
                lightStates[area] 
                  ? 'bg-blue-500 border-blue-600 shadow-lg shadow-blue-500/50' 
                  : 'bg-gray-200 border-gray-400'
              }`}
              onClick={() => handleSwitchToggle(area)}
            >
              <div className={`w-10 h-10 bg-white rounded-full absolute left-1 top-1 transition-all duration-300 shadow-md ${
                lightStates[area] ? 'translate-y-0' : 'translate-y-9'
              }`}></div>
            </div>
            {targetAreas.includes(area) && (
              <span className="text-xs text-yellow-600 font-semibold">TARGET</span>
            )}
          </div>
        ))}
      </div>
    </div>
  );

  // Floor plan layout
  const FloorPlanLayout = () => {
    // Simple grid layout for floor plan
    const floorPlanStyle = {
      display: 'grid',
      gridTemplateColumns: 'repeat(2, 1fr)',
      gap: '20px',
      padding: '20px',
      maxWidth: '600px',
      margin: '0 auto'
    };

    const areaStyle = (area, isOn) => ({
      aspectRatio: '1',
      borderRadius: '12px',
      border: `3px solid ${isOn ? '#3b82f6' : '#374151'}`,
      backgroundColor: isOn ? '#dbeafe' : '#f9fafb',
      cursor: isTaskActive ? 'pointer' : 'not-allowed',
      transition: 'all 0.3s',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      position: 'relative',
      opacity: isTaskActive ? 1 : 0.6,
      boxShadow: isOn ? '0 0 20px rgba(59, 130, 246, 0.5)' : 'none'
    });

    return (
      <div className="w-full">
        <h3 className="mb-6 text-gray-800 text-xl font-semibold text-center">
          Floor Plan Switch Interface
        </h3>
        <div style={floorPlanStyle}>
          {areas.map((area) => (
            <div
              key={area}
              style={areaStyle(area, lightStates[area])}
              onClick={() => handleSwitchToggle(area)}
              className={isTaskActive ? 'hover:scale-105' : ''}
            >
              <div className={`text-4xl font-bold mb-2 ${
                lightStates[area] ? 'text-blue-600' : 'text-gray-600'
              }`}>
                {lightStates[area] ? 'ðŸ’¡' : 'âš«'}
              </div>
              <div className="text-lg font-semibold text-gray-800">
                Area {area}
              </div>
              {targetAreas.includes(area) && (
                <div className="absolute top-2 right-2 bg-yellow-400 text-yellow-900 text-xs font-bold px-2 py-1 rounded">
                  TARGET
                </div>
              )}
            </div>
          ))}
        </div>
      </div>
    );
  };

  return (
    <div className="w-full p-6 bg-white rounded-xl shadow-lg">
      {designType === 'traditional' ? <TraditionalLayout /> : <FloorPlanLayout />}

      {/* Task status indicator */}
      {isTaskActive && (
        <div className="mt-6 text-center">
          <div className="inline-block px-4 py-2 bg-green-100 text-green-800 rounded-full text-sm font-medium">
            Task Active - Turn ON Areas: {targetAreas.join(', ')}
          </div>
        </div>
      )}

      {taskSuccess === true && (
        <div className="mt-6 text-center">
          <div className="inline-block px-4 py-2 bg-green-500 text-white rounded-full text-sm font-bold animate-pulse">
            âœ“ Task Completed Successfully!
          </div>
        </div>
      )}
    </div>
  );
};

export default SwitchPanel;
